import React, { useState } from 'react';
import './style.css';

function AddButton() {
  const [name, setName] = useState("");
  const logs = ()=>{
    console.log("ここにでる");
    setName(()=>{name})

  }
  return (
      <div className="divbtn" onClick={logs}>{name}</div>
  );
}

export default AddButton;
